def comb_sort(list): 
    n = len(list) //2 
    for i in range(n): 
        left, right = [], [] 
        for x in list: 
            if i <= len(list) - (i+1): 
                left.append(x) 
            else: 
                right.append(x) 
        left = comb_sort(left)
        right = comb_sort(right)
        list = left + [x for x in list[:i]] + [x for x in right]
    return list
