def max_path_sum(triangle): 
    # Initialize squares as 0
    squares = [0] * (len(triangle[0]) + 1)

    # Iterate through rows and columns
    for i in range(len(triangle)):
        for j in range(len(triangle[0])):
            # If the current square is 0, make its value the maximum of the sum of the previous row
            # with the current cell's value
            if squares[i + 1][j] == 0:
                squares[i + 1][j] = max(squares[i][j], triangle[i][j])
            # If the current square is not 0, make its value the maximum of the sum of the previous row
            # with the current cell's value and the sum of the next column
            elif squares[i + 1][j] != 0:
                squares[i + 1][j] = max(squares[i][j], squares[i + 1][j - 1])

    return max(squares)
